import { Grid,Box } from "@mui/material";

const Layout = (props: any) => {
    return (
        <>
            <Grid style={{backgroundColor: '#c2c2c2'}} container spacing={2}>
                <Grid item xs={4}>
                    <Box>
                        <h1>Header Part</h1>
                    </Box>
                    <Box display="flex">
                        {props.children}
                    </Box>
                </Grid>
                <Grid item xs={4}>
                </Grid>
            </Grid>
        </>
    )
}

export default Layout;
